import { Typography, Divider } from 'antd';
import './App.css';
import TodoList from './components/TodoList';
import Filters from './components/Filters';
import { setupServer } from './fakeApi';
import { useEffect } from 'react';

setupServer();

const { Title } = Typography;

function App() {
    useEffect(() => {
        fetch("/api/todos", {
            method: 'POST',
            body: JSON.stringify({
                id: 4,
                name: 'Learn React',
                completed: false,
                priority: 'Medium'
            })
        }).then((res) => {
            fetch("/api/todos").then((res) => res.json()).then((res) => {
                console.log("res",res)
            })
        })
    }, [])

    return (
        <div className="app-container">
            <Title style={{ textAlign: 'center' }}>MINI TODOS</Title>
            <Filters />
            <Divider />
            <TodoList />
        </div>
    );
}

export default App;
